import React from 'react';
import * as s from './splitStyle';

const rangeMinPercent = 0;
const rangeMaxPercent = 100;

const Split = () => (
  <div style={{ padding: '50px' }}>
    <s.FilterTimeSlide>
      <s.FilterTimeSlideInner
        rangeMinPercent={rangeMinPercent}
        rangeMaxPercent={rangeMaxPercent}
      />
    </s.FilterTimeSlide>
    <s.FilterTimeRangeWrap>
      <s.FilterTimeRangeMin type="range" />
      <s.FilterTimeRangeMax type="range" />
    </s.FilterTimeRangeWrap>
  </div>
);

export default Split;
